import React, { Component } from "react";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

class ColoredButton extends Component {
    render() {
        return <Button variant="primary" backgroundColor={this.props.color || 'red'}>{this.props.title}</Button>
    };
};

class ProjectCard extends Component {
    render() {
        return <Col sm={6}>
            <Card>
                <Card.Img variant="top"
                          src={this.props.image || 'https://cdn1.thr.com/sites/default/files/imagecache/landscape_928x523/2019/11/the_mandalorian_still_embed.jpg'}/>
                <Card.Body>
                    <Card.Title>{this.props.title || 'Card Title'}</Card.Title>
                    <Card.Text>
                        {this.props.description || 'A sample description.'}
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>
        </Col>
    };
};

export default {ProjectCard, ColoredButton};
